import React from 'react';
import Radio from "@bit/mui-org.material-ui.radio";
import RadioGroup from "@bit/mui-org.material-ui.radio-group";
import FormControlLabel from "@bit/mui-org.material-ui.form-control-label";
import FormControl from "@bit/mui-org.material-ui.form-control";
import FormLabel from "@bit/mui-org.material-ui.form-label";

class FormControlLabelPosition extends React.Component {
  state = {
    value: 'female'
  };

  handleChange = event => {
    this.setState({ value: event.target.value });
		console.log(this.value);
  };

  render() {
    return <FormControl component="fieldset">
        <FormLabel component="legend">labelPlacement</FormLabel>
        <RadioGroup aria-label="position" name="position" value={this.state.value} onChange={this.handleChange} row>
          <FormControlLabel value="top" control={<Radio color="primary" />} label="Top" labelPlacement="top" />
          <FormControlLabel value="start" control={<Radio color="primary" />} label="Start" labelPlacement="start" />
          <FormControlLabel value="bottom" control={<Radio color="primary" />} label="Bottom" labelPlacement="bottom" />
          <FormControlLabel value="end" control={<Radio color="primary" />} label="End" labelPlacement="end" />
        </RadioGroup>
      </FormControl>;
  }
}

export default FormControlLabelPosition;
